import React from "react";
import Button2 from "../../../components/Button2";
import MindMaster from "../../../assets/images/MindMaster.png";
import { faArrowRight } from "@fortawesome/free-solid-svg-icons";
import CurvedArrow from "../../../assets/images/CurvedArrow.png";

const BestSellers = () => {
  return (
    <section className="padding-x flex flex-col md:flex-row  justify-center items-center gap-40 w-full ">
      <div className="flex flex-row justify-center items-center w-fit">
        <div className="flex flex-col gap-6 justify-center items-center w-fit">
          <div className="justify-center items-center w-fit">
            <h1 className="text-4xl font-bold text-balance text-center">
              Check out our best sellers
            </h1>
          </div>
          <Button2 label="Explore our products" icon={faArrowRight} />
        </div>

        <div className="flex justify-start items-start relative">
          <img
            src={CurvedArrow}
            alt="Curved Arrow"
            className="wabsolute h-36 w-36 transform -translate-x-120 -translate-y-20 z-0"
          />
        </div>
      </div>
      <div>
        <img src={MindMaster} alt="MindMaster" className="max-w-full h-auto" />
      </div>
    </section>
  );
};

export default BestSellers;
